        content: "import { For, createSignal, type Accessor, type JSX } from \"solid-js\"\nimport type { DropdownMenuTriggerProps } from \"@kobalte/core/dropdown-menu\"\n\nimport {\n  DropdownMenu,\n  DropdownMenuContent,\n  DropdownMenuGroup,\n  DropdownMenuGroupLabel,\n  DropdownMenuItem,\n  DropdownMenuSeparator,\n  DropdownMenuShortcut,\n  DropdownMenuTrigger,\n} from \"@repo/tailwindcss/ui/v4/dropdown-menu\"\nimport {\n  SidebarMenu,\n  SidebarMenuButton,\n  SidebarMenuItem,\n  useSidebar,\n} from \"@repo/tailwindcss/ui/v4/sidebar\"\n\nconst TeamSwitcher = (props: {\n  teams: {\n    name: string\n    logo: Accessor<JSX.Element>\n    plan: string\n  }[]\n}) => {\n  // eslint-disable-next-line solid/reactivity\n  const [activeTeam, setActiveTeam] = createSignal(props.teams[0])\n  const { isMobile } = useSidebar()\n\n  return (\n    <SidebarMenu>\n      <SidebarMenuItem>\n        <DropdownMenu\n          placement={isMobile() ? \"bottom-end\" : \"right-start\"}\n          sameWidth\n        >\n          <DropdownMenuTrigger\n            as={(props: DropdownMenuTriggerProps) => (\n              // @ts-expect-error\n              <SidebarMenuButton\n                {...props}\n                size=\"lg\"\n                class=\"data-[expanded]:bg-sidebar-accent data-[expanded]:text-sidebar-accent-foreground\"\n              >\n                <div class=\"bg-sidebar-primary text-sidebar-primary-foreground flex aspect-square size-8 items-center justify-center rounded-lg\">\n                  {activeTeam().logo()}\n                </div>\n                <div class=\"grid flex-1 text-left text-sm leading-tight\">\n                  <span class=\"truncate font-semibold\">\n                    {activeTeam().name}\n                  </span>\n                  <span class=\"truncate text-xs\">{activeTeam().plan}</span>\n                </div>\n                <svg\n                  xmlns=\"http://www.w3.org/2000/svg\"\n                  class=\"ml-auto size-4\"\n                  viewBox=\"0 0 24 24\"\n                >\n                  <path\n                    fill=\"none\"\n                    stroke=\"currentColor\"\n                    stroke-linecap=\"round\"\n                    stroke-linejoin=\"round\"\n                    stroke-width=\"2\"\n                    d=\"m7 15l5 5l5-5M7 9l5-5l5 5\"\n                  />\n                </svg>\n              </SidebarMenuButton>\n            )}\n          />\n          <DropdownMenuContent class=\"w-[--kb-popper-anchor-width] min-w-56 rounded-lg\">\n            <DropdownMenuGroup>\n              <DropdownMenuGroupLabel class=\"text-muted-foreground text-xs\">\n                Teams\n              </DropdownMenuGroupLabel>\n              <For each={props.teams}>\n                {(team, index) => (\n                  <DropdownMenuItem\n                    onClick={() => setActiveTeam(team)}\n                    class=\"gap-2 p-2\"\n                  >\n                    <div class=\"flex size-6 items-center justify-center rounded-sm border\">\n                      {team.logo()}\n                    </div>\n                    {team.name}\n                    <DropdownMenuShortcut>âŒ˜{index() + 1}</DropdownMenuShortcut>\n                  </DropdownMenuItem>\n                )}\n              </For>\n            </DropdownMenuGroup>\n            <DropdownMenuSeparator />\n            <DropdownMenuItem class=\"gap-2 p-2\">\n              <div class=\"bg-background flex size-6 items-center justify-center rounded-md border\">\n                <svg\n                  xmlns=\"http://www.w3.org/2000/svg\"\n                  class=\"size-4\"\n                  viewBox=\"0 0 24 24\"\n                >\n                  <path\n                    fill=\"none\"\n                    stroke=\"currentColor\"\n                    stroke-linecap=\"round\"\n                    stroke-linejoin=\"round\"\n                    stroke-width=\"2\"\n                    d=\"M5 12h14m-7-7v14\"\n                  />\n                </svg>\n              </div>\n              <div class=\"text-muted-foreground font-medium\">Add team</div>\n            </DropdownMenuItem>\n          </DropdownMenuContent>\n        </DropdownMenu>\n      </SidebarMenuItem>\n    </SidebarMenu>\n  )\n}\n\nexport default TeamSwitcher\n"
